import { Box, Container, Link, Stack, Text } from "@chakra-ui/react";
import Navbar from "./Navbar";


function Home(){
   
    return (
        <div>
             <Navbar/>

        <Stack width="80%" margin="auto">
        <Container fontSize="3rem" marginTop="20px">
            <Box width="90%"  margin="auto" fontStyle="oblique" fontFamily="monospace">
            <Text>Finally, time tracking that your team actually wants to use.</Text>
            </Box>
        </Container>

        <Text fontSize="17px" >Intuitive time tracking. Instant report generation. Automatic invoice creation.</Text>
        
        </Stack>
        </div>
    )
}

export default Home;
